import React from 'react'
import {IProduct} from '../model'

interface ProductProps{
    product: IProduct
}


const Product = ({product}: ProductProps) => {
  return (
    <div className='grid col-span-5 gap-7'>
        <div>
        {product.id}
        </div>
        {product.title}
        {product.price}
        {product.description}
        {product.category}
    </div>
  )
}

export default Product
